float fact(int n)
{
	int r = 1;
	while(n) r *= (n--);
	return r;
}

#define FF(i,m) (fact((i)+(m))/(fact(i)*fact(m)))

float Gcoeff(int I[4], int J[4])
{
	if(I[0]==-1 || J[0] ==-1) return 0;
	return (FF(I[0],J[0]) * FF(I[1],J[1]) * FF(I[2],J[2]) * FF(I[3],J[3]))/2.0;
}

