#ifdef _GAUSSIAN_QUADRATURE_
void 
QuadTetElement::computeStiffness()
{
	//4 point Gaussian Quadrature
	//material constants
	float c1 = (E*(1-v))/((1.0-2.0*v)*(1.0+v)),
		c2 = (E*v)/((1.0-2.0*v)*(1.0+v)),
		c3 = (c1 - c2)/2.0;
	//printf("%f %f %f\n",c1,c2,c3);

	float C[6][6] =
	{
		{ c1, c2, c2, 0, 0, 0 },
		{c2, c1, c2, 0, 0, 0 },
		{c2, c2, c1, 0, 0, 0 },
		{0, 0, 0, c3, 0, 0 },
		{0, 0, 0, 0, c3, 0 },
		{0, 0, 0, 0, 0, c3 }
	};

	GenMatrix<float,6,6> E(C);


	K.zeroOut();

	float a = (5.0 + 3.0 * sqrt(5.0))/20.;
	float b = (5.0 - sqrt(5.0))/20.;

	float S[4][4] = { {a,b,b,b},
					  {b,a,b,b},
					  {b,b,a,b},
					  {b,b,b,a} };

	float weight = 0.25;

	for(int i=0;i<4;i++)
	{
		GenMatrix<float, 6, 30> B;
		float det;

		computeB(S[i],&B, &det);
		K = K + (B.transpose() * E * B * (det * weight));
	}

	K = K * (1.0/6.0);
}
#endif

